import React, { useEffect, useState, useMemo, useCallback } from 'react';
import { GoogleMap, MarkerF, InfoWindowF, useLoadScript } from '@react-google-maps/api';
import CoordenadasService from '../services/CoordenadasService';
import PersonasService from '../services/PersonaService'; // Asegúrate de tener este servicio
import { Dropdown } from 'primereact/dropdown'; // Si usas PrimeReact para el dropdown

const MapaMultiple = () => {
    const { isLoaded } = useLoadScript({
        googleMapsApiKey: "AIzaSyBomnY9UemevV5IVEXtYHP6SWw3kRsERGc", // Reemplaza con tu API Key
    });

    const [markers, setMarkers] = useState([]);
    const [selectedMarker, setSelectedMarker] = useState(null);
    const [isInfoWindowOpen, setIsInfoWindowOpen] = useState(false);
    const [personas, setPersonas] = useState([]);
    const [selectedPersona, setSelectedPersona] = useState(null);
    const [error, setError] = useState(null);
    const [isLoading, setIsLoading] = useState(true);

    const defaultCenter = { lat: 4.5709, lng: -74.2973 }; // Centrado en Colombia

    // Función para obtener coordenadas
    const fetchCoordenadas = useCallback(async () => {
        try {
            setIsLoading(true);
            const coordenadasList = await CoordenadasService.getCoordenadas();
            console.log("Coordenadas recibidas:", coordenadasList); // Para depuración

            const validMarkers = coordenadasList.map(coordenadas => {
                const lat = parseFloat(coordenadas.latitud);
                const lng = parseFloat(coordenadas.longitud);
                return { id: coordenadas.id, marca: coordenadas.marca, lat, lng };
            });
            setMarkers(validMarkers);
            setError(null);
        } catch (error) {
            console.error('Error al obtener coordenadas:', error);
            setError(error.message || 'Error al obtener las coordenadas');
        } finally {
            setIsLoading(false);
        }
    }, []);

    // Función para obtener personas
    const fetchPersonas = useCallback(async () => {
        try {
            const personasList = await PersonasService.getAll(); // Asegúrate de que este método esté definido en tu servicio
            setPersonas(personasList);
        } catch (error) {
            console.error('Error al obtener personas:', error);
            setError(error.message || 'Error al obtener las personas');
        }
    }, []);

    useEffect(() => {
        fetchCoordenadas();
        fetchPersonas();
    }, [fetchCoordenadas, fetchPersonas]);

    const handleMarkerClick = (marker) => {
        setSelectedMarker(marker);
        setIsInfoWindowOpen(true);
    };

    const handleInfoWindowClose = () => {
        setIsInfoWindowOpen(false);
        setSelectedMarker(null);
    };

    const handlePersonaSelect = async (persona) => {
        setSelectedPersona(persona);
        try {
            const coordenadas = await CoordenadasService.getCoordenadasPorIds([persona.id]); // Cambia la lógica según tu necesidad
            console.log("Coordenadas para la persona seleccionada:", coordenadas); // Para depuración
            // Actualiza los marcadores o realiza la lógica necesaria
        } catch (error) {
            console.error('Error al obtener coordenadas para la persona:', error);
        }
    };

    const renderMap = useMemo(() => {
        if (!isLoaded) return null;

        return (
            <GoogleMap
                mapContainerStyle={{ height: '400px', width: '100%' }}
                center={defaultCenter}
                zoom={5}
            >
                {markers.map(marker => (
                    <MarkerF
                        key={marker.id}
                        position={{ lat: marker.lat, lng: marker.lng }}
                        onClick={() => handleMarkerClick(marker)}
                    >
                        {isInfoWindowOpen && selectedMarker?.id === marker.id && (
                            <InfoWindowF
                                position={{ lat: marker.lat, lng: marker.lng }}
                                onCloseClick={handleInfoWindowClose}
                            >
                                <div>
                                    <h3>{marker.marca}</h3>
                                    <p>ID: {marker.id}</p>
                                    <p>Latitud: {marker.lat.toFixed(6)}</p>
                                    <p>Longitud: {marker.lng.toFixed(6)}</p>
                                </div>
                            </InfoWindowF>
                        )}
                    </MarkerF>
                ))}
            </GoogleMap>
        );
    }, [isLoaded, markers, isInfoWindowOpen, selectedMarker]);

    return (
        <div>
            <h2>Mapa de Ubicaciones</h2>
            {error && <p style={{ color: 'red' }}>{error}</p>}
            {isLoading && <p>Cargando...</p>}
            <Dropdown 
                value={selectedPersona} 
                options={personas} 
                onChange={(e) => handlePersonaSelect(e.value)} 
                placeholder="Selecciona una persona" 
                optionLabel="nombre" // Asegúrate de que este sea el campo correcto
            />
            {renderMap}
        </div>
    );
};

export default MapaMultiple;
